/*
 * This is the primary high-level API for the project. In this folder there should be:
 * A class called InsightFacade, this should be in a file called InsightFacade.ts.
 * You should not change this interface at all or the test suite will not work.
 */

export enum InsightDatasetKind {
	Sections = "sections",
	Rooms = "rooms",
}

export interface InsightDataset {
	id: string;
	kind: InsightDatasetKind;
	numRows: number;
}

export interface InsightResult {
	[key: string]: string | number;
}

export class InsightError extends Error {
	constructor(message?: string) {
		super(message);
		Error.captureStackTrace(this, InsightError);
	}
}

export class NotFoundError extends Error {
	constructor(message?: string) {
		super(message);
		Error.captureStackTrace(this, NotFoundError);
	}
}

export class ResultTooLargeError extends Error {
	constructor(message?: string) {
		super(message);
		Error.captureStackTrace(this, ResultTooLargeError);
	}
}

export interface IInsightFacade {
	/**
	 * Add a dataset to insightUBC.
	 *
	 * @param id  The id of the dataset being added. Follows the format /^[^_]+$/
	 * @param content  The base64 content of the dataset. This content should be in the form of a serialized zip file.
	 * @param kind  The kind of the dataset
	 *
	 * @return Promise <string[]>
	 *
	 * The promise should fulfill on a successful add, reject for any failures.
	 * The promise should fulfill with a string array,
	 * containing the ids of all currently added datasets upon a successful add.
	 * The promise should reject with an InsightError describing the error.
	 *
	 * An id is invalid if it contains an underscore, or is only whitespace characters.
	 * If id is the same as the id of an already added dataset, the dataset should be rejected and not saved.
	 *
	 * After receiving the dataset, it should be processed into a data structure of
	 * your design. The processed data structure should be persisted to disk; your
	 * system should be able to load this persisted value into memory for answering
	 * queries.
	 *
	 * Ultimately, a dataset must be added or loaded from disk before queries can
	 * be successfully answered.
	 */
	addDataset(id: string, content: string, kind: InsightDatasetKind): Promise<string[]>;

	/**
	 * Remove a dataset from insightUBC.
	 *
	 * @param id  The id of the dataset to remove. Follows the format /^[^_]+$/
	 *
	 * @return Promise <string>
	 *
	 * The promise should fulfill upon a successful removal, reject on any error.
	 * Attempting to remove a dataset that hasn't been added yet counts as an error.
	 *
	 * An id is invalid if it contains an underscore, or is only whitespace characters.
	 *
	 * The promise should fulfill the id of the dataset that was removed.
	 * The promise should reject with a NotFoundError (if a valid id was not yet added)
	 * or an InsightError (invalid id or any other source of failure) describing the error.
	 *
	 * This will delete both disk and memory caches for the dataset for the id meaning
	 * that subsequent queries for that id should fail unless a new addDataset happens first.
	 */
	removeDataset(id: string): Promise<string>;

	/**
	 * Perform a query on insightUBC.
	 *
	 * @param query  The query to be performed.
	 *
	 * If a query is incorrectly formatted, references a dataset not added (in memory or on disk),
	 * or references multiple datasets, it should be rejected.
	 *
	 * @return Promise <InsightResult[]>
	 *
	 * The promise should fulfill with an array of results.
	 * The promise should reject with a ResultTooLargeError (if the query returns too many results)
	 * or an InsightError (for any other source of failure) describing the error.
	 */
	performQuery(query: unknown): Promise<InsightResult[]>;

	/**
	 * List all currently added datasets, their types, and number of rows.
	 *
	 * @return Promise <InsightDataset[]>
	 * The promise should fulfill an array of currently added InsightDatasets, and will only fulfill.
	 */
	listDatasets(): Promise<InsightDataset[]>;
}

import {
	IInsightFacade,
	InsightDataset,
	InsightDatasetKind,
	InsightError,
	InsightResult,
	NotFoundError
} from "./IInsightFacade";
import {Section} from "./CourseHelper";
import {Dataset} from "./DatasetHelper";
import * as fs from "fs-extra";
import {CheckQuery} from "./CheckQuery";
import {SearchQuery} from "./SearchQuery";
import {AddCourse} from "./AddCourse";
import {AddRoom} from "./AddRoom";

/**
 * This is the main programmatic entry point for the project.
 * Method documentation is in IInsightFacade
 *
 */
export default class InsightFacade implements IInsightFacade {
	private static datasets: Map<string, Dataset>;
	private static IDs: string[];
	constructor() {
		// console.log("InsightFacadeImpl::init()");
		InsightFacade.datasets = new Map<string, Dataset>();
		InsightFacade.IDs = [];
		InsightFacade.checkcrash(InsightFacade.IDs, InsightFacade.datasets);
	}

	public addDataset(ID: string, content: string, kind: InsightDatasetKind): Promise<string[]> {
		return new Promise((fulfill, reject) => {
			if (InsightFacade.checkValidID(ID)) {
				return reject(new InsightError("Invalid Dataset ID!"));
			}

			if (kind === InsightDatasetKind.Sections){
				let courses = new AddCourse(this);
				courses.addCourse(ID, content, kind).then((r)  =>{
					return fulfill(r);
				}).catch((e: any) => {
					return reject(e);
				});
			} else {
				let rooms = new AddRoom(this);
				rooms.addRoom(ID, content, kind).then((r)  =>{
					return fulfill(r);
				}).catch((e: any) => {
					return reject(e);
				});
			}
		});
	}

	public removeDataset(id: string): Promise<string> {
		return new Promise((fulfill, reject) => {
			if (id === "" || !id.trim() || id.includes("_")) {
				return reject(new InsightError("Invalid Dataset ID!"));
			}
			if (!InsightFacade.IDs.includes(id)) {
				return reject(new NotFoundError("Non-exist Dateset ID!"));
			}
			fs.unlinkSync("./data/" + id + ".json");
			InsightFacade.datasets.delete(id);
			const index = InsightFacade.IDs.indexOf(id, 0);
			if (index > -1) {
				InsightFacade.IDs.splice(index, 1);
			}
			return fulfill(id);
		});
	}

	public performQuery(que: unknown): Promise<InsightResult[]> {
		return new Promise((resolve, reject) => {
 			let query: CheckQuery;
			query = new CheckQuery(InsightFacade.IDs);
			let quer: any = que;
			let search: SearchQuery;
			query
				.checkQuery(que)
				.then(() => {
					search = new SearchQuery(quer.WHERE, InsightFacade.datasets.get(query.getDataset()));
					return search.searchQuery();
				})
				.then((sec) => {
					// console.log(sec);
					return resolve(this.displayQuery(sec, quer, query.getDataset()));
				})
				.catch((err) => {
					return reject(err);
				});
		});
	}

	private displayQuery(secs: Section[], query: any, id: string): InsightResult[] {
		let arr: any[] = [];
		let result = this.displaySections(secs, query, id, arr);
		return this.displayOrder(result, query.OPTIONS);
	}

	private displaySections(secs: Section[], query: any, id: string, arr: any[]): InsightResult[] {
		let keys = query.OPTIONS.COLUMNS;
		for (const sec of secs) {
			let obj = this.displaySection(sec, keys, id);
			arr.push(obj);
		}
		return arr;
	}

	private displaySection(sec: Section, keys: string[], id: string): InsightResult {
		let obj = Object.create(null);
		for (const key of keys) {
			if (key === id.concat("_uuid")) {
				obj[key] = sec.uuid;
			} else if (key === id.concat("_year")) {
				obj[key] = sec.year;
			} else if (key === id.concat("_dept")) {
				obj[key] = sec.dept;
			} else if (key === id.concat("_id")) {
				obj[key] = sec.id;
			} else if (key === id.concat("_title")) {
				obj[key] = sec.title;
			} else if (key === id.concat("_instructor")) {
				obj[key] = sec.instructor;
			} else if (key === id.concat("_avg")) {
				obj[id.concat("_avg")] = sec.avg;
			} else if (key === id.concat("_pass")) {
				obj[key] = sec.pass;
			} else if (key === id.concat("_fail")) {
				obj[key] = sec.fail;
			} else {
				obj[key] = sec.audit;
			}
		}
		return obj;
	}

	private displayOrder(secs: any[], obj: any): InsightResult[] {
		if (obj["ORDER"] === null) {
			return secs;
		} else {
			for (let i = 0; i < secs.length; i++) {
				let min = this.findMin(secs, i, obj.ORDER);
				let s = secs[i];
				secs[i] = secs[min];
				secs[min] = s;
			}
			return secs;
		}
	}

	private findMin(secs: any[], i: number, str: string): number {
		let j = i;
		let min: number = i;
		while (j !== secs.length) {
			if (typeof secs[j][str] === "string") {
				if (secs[j][str].localeCompare(secs[min][str]) <= 0) {
					min = j;
				}
			} else {
				if (secs[j][str] <= secs[min][str]) {
					min = j;
				}
			}
			j++;
		}
		return min;
		// return secs.sort();
	}

	public listDatasets(): Promise<InsightDataset[]> {
		let results: InsightDataset[] = [];
		return new Promise((fulfill) => {
			InsightFacade.datasets.forEach(function (value: Dataset) {
				let result = value.insightDataset;
				results.push(result);
			});
			return fulfill(results);
		});
	}

	public static store(ID: string, dataset: Dataset): string[] {
		fs.ensureDirSync("./data");
		const json = JSON.stringify(dataset);
		fs.writeFileSync("./data/" + dataset.id + ".json", json);
		this.datasets.set(ID, dataset);
		this.IDs.push(ID);
		return this.IDs;
	}

	private static checkValidID(ID: string): boolean {
		return (
			// empty string case
			ID === null ||
			ID === undefined ||
			!ID.trim() ||
			ID.includes("_") ||
			InsightFacade.IDs.includes(ID) ||
			fs.existsSync("./data/" + ID + ".json")
			// C2
			// kind !== InsightDatasetKind.Sections
		);
	}

	private static checkcrash(IDs: string[], datasets: Map<string, Dataset>) {
		const dir = "./data";
		if (fs.existsSync(dir)) {
			// old datasets already exist
			fs.readdirSync(dir).forEach((file) => {
				const id = file.substring(0, file.lastIndexOf(".")) || file;
				if (!IDs.includes(id)) {
					IDs.push(id);
				}
				if (!datasets.has(id)) {
					const obj = fs.readJsonSync("./data/" + id + ".json");
					const sections: Section[] = [];
					for (const sec of obj.sections) {
						const section = new Section(
							sec.uuid,
							sec.id,
							sec.title,
							sec.instructor,
							sec.dept,
							sec.year,
							sec.avg,
							sec.pass,
							sec.fail,
							sec.audit
						);
						sections.push(section);
					}
					const dataset = new Dataset(id, sections, InsightDatasetKind.Sections);
					datasets.set(id, dataset);
				}
			});
		}
	}
}

export class Section {
	public readonly uuid: string;
	public readonly id: string;
	public readonly title: string;
	public readonly instructor: string;
	public readonly dept: string;
	public readonly year: number;
	public readonly avg: number;
	public readonly pass: number;
	public readonly fail: number;
	public readonly audit: number;

	constructor(
		id: string,
		Course: string,
		Title: string,
		Professor: string,
		Subject: string,
		Year: number,
		Avg: number,
		Audit: number,
		Pass: number,
		Fail: number
	) {
		this.uuid = id;
		this.id = Course;
		this.title = Title;
		this.instructor = Professor;
		this.dept = Subject;
		this.year = Year;
		this.avg = Avg;
		this.pass = Pass;
		this.fail = Fail;
		this.audit = Audit;
	}
}

import {InsightDataset, InsightDatasetKind} from "./IInsightFacade";
import {Section} from "./CourseHelper";
export class Dataset {
	public sections: Section[];
	public id: string;
	public insightDataset: InsightDataset;
	public kind: InsightDatasetKind;
	constructor(id: string, section: any[], kind: InsightDatasetKind) {
		this.id = id;
		this.sections = section;
		this.kind = kind;
		this.insightDataset = {
			id: this.id,
			kind: this.kind,
			numRows: this.sections.length,
		};
	}
}

import {InsightError, InsightResult} from "./IInsightFacade";
import {rejects} from "assert";
import InsightFacade from "./InsightFacade";

export class CheckQuery {
	private dataset: string;
	private ids: string[];
	constructor(ids: string[]) {
		this.dataset = "";
		this.ids = ids;
	}

	public getDataset(): string {
		return this.dataset;
	}

	/* if query is invalid, return 1;
	   if query is valid, return 0;
	 */
	public checkQuery(que: unknown): Promise<any> {
		return new Promise((resolve, reject) => {
			if (que === null || typeof que !== "object") {
				return reject(new InsightError("invalid"));
			}
			let query: any = que as any;
			// check where
			if (query.WHERE !== null) {
				if (typeof query.WHERE !== "object" || Array.isArray(query.WHERE)) {
					return reject(new InsightError("invalid"));
				}
				let arr = Object.keys(query.WHERE);
				if (arr.length > 1) {
					return reject(new InsightError("invalid"));
				} else if (arr.length === 0){
					// do nothing
				} else {
					let res: number = this.checkFilter(arr[0], query.WHERE);
					if (res === 1) {
						return reject(new InsightError("invalid"));
					}
				}
			}
			// check options
			if (!query.OPTIONS || typeof query.OPTIONS !== "object") {
				return reject(new InsightError("invalid"));
			} else {
				let array;
				array = Object.keys(query.OPTIONS);
				if (!array.includes("COLUMNS")) {
					return reject(new InsightError("invalid"));
				} else {
					for (const ele of array) {
						if (ele === "COLUMNS") {
							let res = this.checkColumn(query.OPTIONS.COLUMNS);
							if (res === 1) {
								return reject(new InsightError("invalid"));
							}
						} else if (ele === "ORDER") {
							let res: number = this.checkOrder(query.OPTIONS);
							if (res === 1) {
								return reject(new InsightError("invalid"));
							}
						} else {
							return reject(new InsightError("invalid"));
						}
					}
				}
			}
			return resolve(" ");
		});
	}

	private checkFilter(item: string, obj: any): number {
		let res: number;
		if (item === "OR") {
			// console.log("or:");
			res = this.checkQueryOrAnd(obj.OR);
			// console.log("or-result");
			// console.log(res);
		} else if (item === "AND") {
			// console.log("and:");
			res = this.checkQueryOrAnd(obj.AND);
			// console.log("and-result");
			// console.log(res);
		} else if (item === "GT") {
			res = this.checkQueryGtLtEq(obj.GT);
			// console.log("gt-result");
			// console.log(res);
		} else if (item === "LT") {
			// console.log("lt:");
			res = this.checkQueryGtLtEq(obj.LT);
			// console.log("lt-result");
			// console.log(res);
		} else if (item === "EQ") {
			res = this.checkQueryGtLtEq(obj.EQ);
			// console.log("eq-result");
			// console.log(res);
		} else if (item === "IS") {
			res = this.checkQueryIs(obj.IS);
			// console.log("is-result");
			// console.log(res);
		} else if (item === "NOT") {
			// console.log("not");
			res = this.checkQueryNot(obj.NOT);
			// console.log("not-result");
			// console.log(res);
		} else {
			res = 1;
		}
		return res;
	}

	private checkQueryOrAnd(arr: any): number {
		if (!Array.isArray(arr)) {
			// console.log("or-array");
			return 1;
		} else if (arr.length === 0) {
			return 1;
		} else {
			for (const obj of arr) {
				let array;
				array = Object.keys(obj);
				if (array.length === 0) {
					return 1;
				}
				for (const key of array) {
					let result: number;
					result = this.checkFilter(key, obj);
					if (result === 1) {
						return 1;
					}
				}
			}
			return 0;
		}
	}

	private checkQueryNot(obj: any): number {
		// console.log(obj);
		if (typeof obj !== "object") {
			return 1;
		} else {
			let arr;
			arr = Object.keys(obj);
			if (arr.length !== 1) {
				return 1;
			} else {
				// console.log(obj.NOT);
				return this.checkFilter(arr[0], obj);
			}
		}
	}

	private checkQueryGtLtEq(obj: any): number {
		// console.log("gtlteq");
		if (typeof obj !== "object") {
			// console.log("lt-object");
			return 1;
		} else {
			let arr;
			arr = Object.keys(obj);
			// console.log("lt-else");
			if (arr.length !== 1) {
				console.log("lt-length");
				return 1;
			} else {
				// console.log("lt-else-else");
				if (this.checkKey(arr[0], "m")) {
					// console.log("lt-key");
					return 1;
				} else if (typeof obj[arr[0]] !== "number") {
					// console.log("lt-arr");
					// console.log(obj[arr[0]]);
					return 1;
				} else {
					return 0;
				}
			}
		}
	}

	private checkQueryIs(obj: any): number {
		if (typeof obj !== "object") {
			// console.log("is-object");
			return 1;
		} else {
			let arr;
			arr = Object.keys(obj);
			if (arr.length !== 1) {
				return 1;
			} else {
				if (this.checkKey(arr[0], "s")) {
					// console.log("is-key");
					return 1;
				} else if (typeof obj[arr[0]] !== "string") {
					// console.log("is-arr");
					// console.log(obj[arr[0]]);
					return 1;
				}
				if (obj[arr[0]].includes("*")) {
					if (obj[arr[0]].length > 2) {
						if (obj[arr[0]].substring(1, obj[arr[0]].length - 1).includes("*")) {
							// console.log("is-include*");
							return 1;
						}
					}
				}
			}
			return 0;
		}
	}

	private checkKey(str: string, type: string): number {
		let div: number;
		div = str.search("_");
		if (div === 0) {
			// console.log("key-0");
			return 1;
		}
		// check dataset
		if (this.dataset === "") {
			this.dataset = str.substring(0, div);
		} else if (this.dataset !== str.substring(0, div)) {
			// console.log("key-dataset");
			return 1;
		} else if (!this.ids.includes(this.dataset)) {
			return 1;
		}
		// check field
		let field: string;
		field = str.substring(div + 1);
		if (type.includes("s")) {
			if (field === "dept" || field === "id" || field === "uuid" || field === "instructor" || field === "title") {
				return 0;
			}
		}
		if (type.includes("m")) {
			// console.log("key-m");
			// console.log(field);
			if (field === "avg" || field === "pass" || field === "fail" || field === "audit" || field === "year") {
				// console.log("key-m-if");
				return 0;
			}
		}
		return 1;
	}

	private checkColumn(arr: any): number {
		if (!Array.isArray(arr)) {
			return 1;
		} else if (arr.length === 0) {
			return 1;
		} else {
			for (const field of arr) {
				if (typeof field !== "string") {
					return 1;
				} else if (this.checkKey(field, "sm")) {
					return 1;
				}
			}
			return 0;
		}
	}

	private checkOrder(obj: any): number {
		if (typeof obj.ORDER !== "string") {
			return 1;
		} else {
			if (!obj.COLUMNS.includes(obj.ORDER)) {
				return 1;
			} else {
				return 0;
			}
		}
	}
}

import {Section} from "./CourseHelper";
import {ResultTooLargeError} from "./IInsightFacade";
export class SearchQuery {
	private query;
	private unchecked: Section[];
	private valid_sections: Section[];
	constructor(que: any, ds: any) {
		this.query = que;
		this.unchecked = ds.sections;
		this.valid_sections = [];
	}

	public searchQuery(): Promise<Section[]> {
		return new Promise((resolve, reject) => {
			for (const sec of this.unchecked) {
				let num: number;
				num = this.filterSection(sec);
				if (num === 0) {
					this.valid_sections.push(sec);
				}
			}
			if (this.valid_sections.length > 5000) {
				return reject(new ResultTooLargeError("> 5000"));
			} else {
				console.log(this.valid_sections.length);
				return resolve(this.valid_sections);
			}
		});
	}

	private filterSection(sec: Section): number {
		let arr = Object.keys(this.query);
		if (arr.length === 0) {
			return 0;
		}
		for (const key of arr) {
			let res = this.filterKey(sec, key, this.query);
			if (res) {
				return 1;
			}
		}
		return 0;
	}

	// str: the name of the key
	// obj: the object includes the str
	private filterKey(sec: Section, str: string, obj: any): number {
		if (str === "OR") {
			return this.filterOr(obj.OR, sec);
		} else if (str === "AND") {
			return this.filterAnd(obj.AND, sec);
		} else if (str === "NOT") {
			return this.filterNot(obj.NOT, sec);
		} else if (str === "GT") {
			return this.filterGt(obj, sec);
		} else if (str === "LT") {
			return this.filterLt(obj, sec);
		} else if (str === "EQ") {
			return this.filterEq(obj, sec);
		} else if (str === "IS") {
			return this.filterIs(obj, sec);
		}
		return 1;
	}

	private filterOr(array: any, sec: Section): number {
		for (const obj of array) {
			if (this.filterKey(sec, Object.keys(obj)[0], obj) === 0) {
				return 0;
			}
		}
		return 1;
	}

	private filterAnd(array: any, sec: Section) {
		for (const obj of array) {
			if (this.filterKey(sec, Object.keys(obj)[0], obj) === 1) {
				return 1;
			}
		}
		return 0;
	}

	private filterNot(obj: any, sec: Section): number {
		let arr = Object.keys(obj);
		if (this.filterKey(sec, arr[0], obj)) {
			return 0;
		} else {
			return 1;
		}
	}

	private filterGt(obj: any, sec: Section): number {
